window.bookSummaryJSON = "<p><i>Damien thought his exams would be bad enough. Then his mother collapsed with a failing heart</i>.&nbsp;&nbsp;&nbsp;</p> <p>In a desperate move Damien throws himself into the Streamer Contest of Saga Online, the latest fantasy VR-MMORPG. Winning will provide the funds for his momâ€™s surgery. Yet early betrayal and a close run in with a vampire almost ruin his attempt before he even begins.</p> <p>Stuck at the bottom of a dungeon with no gear, no allies and little hope, Damien must embrace the undiscovered Occultist class, master control of his new demon companions and take the contest by storm. His plan is simple enough. Topple the most famous player in Saga Online.&nbsp;&nbsp;&nbsp;</p> <p><i>Summon your imps. Prepare for battle! </i></p>"; 
